// the long list of cryptocoins
import React from "react";
import CoinItem from "./CoinItem";
import { Link } from 'react-router-dom';
import Coin from "../routes/Coin";

const Coins = (props) => {
    return (
        <div>
            <div className=" rounded-xl w-auto">
                <div className='grid grid-cols-3 lg:grid-cols-6 lg:gap-2 font-bold py-5'>

                    <p className="ml-10">#</p>
                    <p className="">Coin</p>
                    <p className="">Price</p>
                    <p className="collapse lg:visible">24h</p>
                    <p className='collapse lg:visible'>Volume</p>
                    <p className='collapse lg:visible'>Mkt Cap</p>
                </div>

                {props.coins.map((coins) => {
                    return (
                        <Link to={`/Coin/${coins.id}`} element={<Coin />} key={coins.id}>
                            <CoinItem coins={coins}/>                    
                        </Link>                        
                    )
                })}

            </div>
        </div>
    );
}

export default Coins;
